// components/Header.js
import React from 'react';
import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';

const StyledNavbar = styled(Navbar)`
  background-color: #fff;
  padding: 1rem 2rem;
  font-size: 1.2rem;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
`;

const StyledNavBrand = styled(Navbar.Brand)`
  font-size: 1.5rem;
  font-weight: bold;
  color: #007bff;
  cursor: pointer;

  &:hover {
    color: #0056b3;
  }
`;

const StyledNavLink = styled(Nav.Link)`
  font-size: 1.2rem;
  margin-right: 1rem;
  color: #555;
  cursor: pointer;

  &:hover {
    color: #007bff;
  }
`;

const StyledNavDropdown = styled(NavDropdown)`
  font-size: 1.2rem;

  .dropdown-menu {
    font-size: 1.2rem;
  }
`;

const Header = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Perform logout logic
    navigate('/login');
  };

  return (
    <StyledNavbar expand="lg">
      <Container>
        <StyledNavBrand onClick={() => navigate('/')}>Nutritracker</StyledNavBrand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <StyledNavLink onClick={() => navigate('/')}>Home</StyledNavLink>
            <StyledNavLink onClick={() => navigate('/search')}>Add Food</StyledNavLink>
            <StyledNavLink onClick={() => navigate('/custom-foods')}>Custom Foods</StyledNavLink>
            <StyledNavLink onClick={() => navigate('/custom-recipes')}>Custom Recipes</StyledNavLink>
          </Nav>
          <Nav>
            <StyledNavDropdown title="Profile" id="basic-nav-dropdown">
              <NavDropdown.Item onClick={() => navigate('/profile')}>Profile</NavDropdown.Item>
              <NavDropdown.Item onClick={handleLogout}>Logout</NavDropdown.Item>
            </StyledNavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </StyledNavbar>
  );
};

export default Header;
